import "./MatchingResultPage.css";
import { Link } from "react-router-dom";
import { useEffect, useState } from "react";
import Axios from "axios"; // Axios를 사용하여 데이터 가져오기

const MatchingResultPage = () => {
  const [matchedUsers, setMatchedUsers] = useState([]); // 빈 배열로 초기화

  // 백엔드 서버의 API 엔드포인트 URL
  const apiEndpoint = "https://example.com/api/matchedUsers"; // 백엔드의 실제 URL로 대체

  useEffect(() => {
    // useEffect를 사용하여 페이지 로드 시 데이터를 가져옵니다.
    Axios.get(apiEndpoint)
      .then((response) => {
        // 백엔드에서 받아온 데이터를 state에 설정
        setMatchedUsers(response.data);
      })
      .catch((error) => {
        console.error("데이터를 가져오는 중 에러 발생: ", error);
      });
  }, []);
const MatchingResultPage = () => {
  // 매칭된 사용자 데이터
  const matchedUsers = [
    {
      profileImage: profile1, // 사용자 1의 프로필 이미지
      nickname: "사용자1",
      gender: "남성",
      age: 25,
      exerciseType: "요가",
      timeSlot: "아침",
      daysOfWeek: "월, 수",
      mbti: "ISTJ",
    },
    {
      profileImage: profile2, // 사용자 2의 프로필 이미지
      nickname: "사용자2",
      gender: "여성",
      age: 30,
      exerciseType: "등산",
      timeSlot: "저녁",
      daysOfWeek: "화, 목",
      mbti: "ENFP",
    },
    // 다른 사용자 데이터 추가
]};

  return (
    <div className="matchingresultpage1">
      <Link to="/"><div className="div65">운동뭉치</div></Link>
      <Link to="/matchingpage"><div className="div66">메이트 매칭</div></Link>
      <img className="rectangle-icon" alt="" src="/rectangle-1@2x.png" />
      <div className="div67">
        <p className="p4">{`운동뭉치에서 여러분에게 딱 맞는 `}</p>
        <p className="p4">운동 메이트를 찾아보세요!</p>
      </div>
      <img
        className="matchingresultpage-child19"
        alt=""
        src="/rectangle-4.svg"
      />
      <b className="b8">빠르고 정확한 매칭을 간단하게</b>
      <div className="div68">어렵지 않게 나와 가장 잘 맞는 메이트 찾기</div>
      <Link to="/myprofilepage"><div className="userid2">USERID님, 환영합니다!</div></Link>
      <div className="div70">매칭결과</div>
      <div className="div71">운동 메이트 매칭 결과를 확인하세요.</div>

      <div className="user-profiles">
        {matchedUsers.map((user, index) => (
          <div key={index} className="user-profile">
            <img src={user.profileImage} alt={user.nickname} className="profile-image" />
            <div className="user-info">
              <p className="user-nickname">{user.nickname}</p>
              <p>{`${user.gender}, ${user.age}세, ${user.exerciseType}`}</p>
              <p>{`${user.timeSlot}, ${user.daysOfWeek}, MBTI: ${user.mbti}`}</p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default MatchingResultPage;
